const Video = () => {
  return (
    <iframe
      title="Proyecto_K"
      width="100%"
      height="100%"
      src="https://www.youtube.com/embed/tHW2aOuaXBA?autoplay=1&rel=0&controls=0"
      frameborder="0"
      allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
      allowfullscreen
    ></iframe>
  );
};

export default Video;
